import React from "react";






class Canlendar  extends React.Component{
	constructor(){
		super();
	}


	render(){
		return (
			<div className="canlendarChooser">
				<h4>2019年4月</h4>
				<table>
					<tr>
						{["周日","周一","周二","周三","周四","周五","周六"].map((item,index)=>{
							return <th key={index} >{item}</th>
						})}
					</tr>

				</table>
			</div>
		)
	}    

}

export default Canlendar;
